import React from 'react';
import ReactModal from 'react-modal';
import { connect } from 'react-redux';
import LessonChooseChart from '../_components/lessonChooseChart';
import './componentcss.css';
import {allActions} from '../_actions'

class LessonChooseGraph extends React.Component {
    constructor () {
      super();
      this.state = {
        showModal: false,
        test: 1,
        lesdata:[]

      };

    }
    render () {
      return (
        <div>

          <ReactModal 
             isOpen={this.props.LessonChooseIsLog}
             contentLabel="Дүнгийн график"
             overlayClassName="Overlay"
             onRequestClose={ () => this.props.LessonChooseFalse()}
             >
            <div > <h1>{JSON.stringify(this.props.LessonChooseData.datedata[1].autumn)}</h1> </div>
            <LessonChooseChart className="amountChart"></LessonChooseChart>
            <button onClick={ () => this.props.LessonChooseFalse()}>Close Modal</button>
          </ReactModal>
        </div>
      );
    }
  }

export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(LessonChooseGraph);
